INSERT INTO `field_body` (pages_id, data) VALUES('27', '<h3>The page you were looking for is not found.</h3>\r\n<p>Please use our search engine or navigation above to find the page.</p>');
INSERT INTO `field_body` (pages_id, data) VALUES('1', '<p>This is a personal selection of beautiful, classy, punk, professional, incomplete, weird typefaces. Open source licenses make them free to use and modify. This selection is the result of deep search and crushes. This selection is yours. <em>RB</em></p>');
INSERT INTO `field_body` (pages_id, data) VALUES('1100', '<p>The goal of this project is to provide a contemporary set of fonts under libre or open source licences, hand picked by a typography and free cultrure lover.</p><p>This project is open to modifications and always looking for collaborators :</p><p>Type designers: If you are interesed to create or fork existing projects</p><p>Web developpers - app wizards: If you want to improve this project to make it more admin and user friendly.</p><p>Have a look to the book Lve future.</p><h2>Contact</h2><p>Do not hesitate to drop me an <a href=\"mailto:bonjour@raphaelbastide.com\">email</a></p>');
INSERT INTO `field_comments` (pages_id, data) VALUES('1114', 'Designed for [http://www.esad-gv.fr](http://www.esad-gv.fr).\r\n\r\nInspired by characters found on cartography from XIX untill middle XX.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1121', 'Generated font made with PureData and Php based on  [Terminus](http://terminus-font.sourceforge.net/).');
INSERT INTO `field_comments` (pages_id, data) VALUES('1128', 'Autopia is a free family Typeface designed by Antoine Gelgon. This project was initiated during the Summer School of OSP in August 2013. The particularity of this fonts is in the process of developing its shape. The skeleton was generated through Autotrace Program (a program that converts bitmap to vectorgraphics). Calligraphic forms were drawn with Python Fontforges code.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1125', 'Terminus Font is a clean, fixed width bitmap font, designed for long (8 and more hours per day) work with computers. Version 4.39 contains 891 characters, covers about 120 language sets and supports ISO8859-1/2/5/7/9/13/15/16, Paratype-PT154/PT254, KOI8-R/U/E/F, Esperanto, many IBM, Windows and Macintosh code pages, as well as the IBM VGA, vt100 and xterm pseudographic characters.\r\nThe sizes present are 6x12, 8x14, 8x16, 10x18, 10x20, 11x22, 12x24, 14x28 and 16x32.\r\nThe styles are normal and bold (except for 6x12), plus EGA/VGA-bold for 8x14 and 8x16.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1135', 'Autopia is a free family Typeface designed by Antoine Gelgon. This project was initiated during the Summer School of OSP in August 2013. The particularity of this fonts is in the process of developing its shape. The skeleton was generated through Autotrace Program (a program that converts bitmap to vectorgraphics). Calligraphic forms were drawn with Python Fontforges code.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1136', 'Free Edit is a Unicode typeface family that supports all languages that use the Latin script and its variants, and could be expanded to support other scripts. Free Edit is a modified version of FreeSans font by GNU FreeFont.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1142', ' Charis is similar to Bitstream Charter, one of the first fonts designed specifically for laser printers. It is highly readable and holds up well in less-than-ideal reproduction environments. It also has a full set of styles - regular, italic, bold, bold italic - and so is more useful in general publishing than Doulos SIL. Charis is a serif, proportionally-spaced font optimized for readability in long printed documents.\r\n\r\nThe goal for this product was to provide a single Unicode-based font family that would contain a comprehensive inventory of glyphs needed for almost any Roman- or Cyrillic-based writing system, whether used for phonetic or orthographic needs. In addition, there is provision for other characters and symbols useful to linguists. This font makes use of state-of-the-art font technologies to support complex typographic issues, such as the need to position arbitrary combinations of base glyphs and diacritics optimally.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1146', 'The Cabin Font is a humanist sans inspired by Edward Johnston\'s and Eric Gill\'s typefaces, with a touch of modernism.\r\nCabin incorporates modern proportions, optical adjustments, and some elements of the geometric sans.\r\nIt remains true to its roots, but has its own personality.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1151', 'Clear Sans was designed with on-screen legibility in mind. It strikes a balance between contemporary, professional, and stylish expression and thoroughly functional purpose. It has a sophisticated and elegant personality at all sizes, and its thoughtful design becomes even more evident at the thin weight.\r\nt has minimized, unambiguous characters and slightly narrow proportions, making it ideal for UI design. Its strong, recognizable forms avoid distracting ambiguity, making Clear Sans comfortable for reading short UI labels and long passages in both screen and print.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1157', ' LOuverte est une police de caractres typographique que je dveloppe dans le cadre de mon DNAT  lsad Valence. Elle est initie dans loptique de devenir un caractre de labeur sans emptement. Elle se rapproche dune linale no-grotesque, avec des contreformes ouvertes et des angles acrs. Elle sinscrit autour de la culture du libre et de lopen-source, par ses manires de diffusion et de conception. Ouverte, la traduction dopen en franais, donc.\r\nCest un projet dans lequel jinterviendrais sur un rythme hebdomadaire, avec un poster, pour montrer l\'avancement de la typographie, mais aussi pour inviter  participer, cest avant tout par un processus collaboratif que la police va se dvelopper.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1160', 'Computer Modern Unicode fonts were converted from metafont sources using mftrace with autotrace backend and fontforge (former pfaedit). Their main purpose is to create free good quality fonts for use in X applications supporting many languages. Currently the fonts contain glyphs from Latin1 (Metafont ec, tc, vnr), Cyrillic (lh) and Greek (cbgreek when available) code sets and IPA extensions (from tipa). Other alphabets are also welcome. Now this set contains 33 fonts');
INSERT INTO `field_comments` (pages_id, data) VALUES('1165', 'A programming font, designed with functionality in mind, and with some wibbly-wobbly handwriting-like fuzziness that makes it unassumingly cool.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1174', 'Gothique');
INSERT INTO `field_comments` (pages_id, data) VALUES('1180', 'Monospaced fonts Quinze is a narrow monospaced font, for programming and terminal emulators. It is designed to be narrow, and allow 132 columns to be comfortably fitted on a screen The 1, l and I are clearly distinguished, as are O and 0. The ascii circumflex is presented as an arrow, consistent with its use as exponentiation operator. Fifteen is a faux bitmap font. This font is designed to be used as a monotype font for use in a terminal, or at a larger size, to look like an over scaled bitmap. It is designed for 15 pixel use. It is as narrow as I could make it, and works well in a 132 column terminal window. It is, of course, monospaced and has clearly distinct 1I and l, and the zero is slashed. Character set is limited in this first release to ascii + smart quotes.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1182', 'Designed to integrate with the character of the OS, the Fira Sans typeface also aims to cover the legibility needs for a large range of handsets varying in screen quality and rendering. When working with Fira Sans it is recommended that micro font sizes that fall below our guidelines are avoided.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1185', 'Futura Renner family is a digital version of Futura lead character belonging to the typography department of Ecole Nationale Suprieure des Arts de la Cambre, and probably the first draft of Futura as we know it.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1190', 'Career is a Caslon-like inspired by Playboy magazines from the seventies.');
INSERT INTO `field_comments` (pages_id, data) VALUES('1195', 'Narrow');
